    [],nt"revision_timestamp": "2016-05-31T01:07:19.357847",nt"name": "afsc-abl-seafloor-habitat-assessment",nt"isopen":
    false,nt"url": null,nt"notes": "Since 1988, scientists at the Auke Bay
    Laboratories have been using the /Delta/ submarine for a wide range of research
    projects. Over 500 dives have been completed. The video collected during these projects
    provides valuable direct observations of seafloor habitat and biological attributes.
    This project is assembling a database that will include dive locations and basic
    biological and substrate information from each of the dives. To date, biological
    and substrate data have been processed for about 40% of the dives.",nt"license_title":
